messages.content:
> Protesting the flag is not an effective way to raise awareness of black oppression. There are other ways to do that that don’t contradict a symbol of unity.
@Mr. Poopybutthole  first off, a symbol of unity? Dude there’s no unity if we can’t even treat people the same based on the color of their skin. It’s hard to be patriotic when you’re scared to be pulled over by a cop. Black people owe the flag absolutely nothing. 

Second, It’s very clear that they aren’t protesting the flag. They’ve stated what they are protesting: police violence against black people. People are saying shit like “they’re protesting veterans” and shit like that. That’s not the intent. They’re using the national anthem as a stage to get an audience. It’s considered normal to stand for the anthem, and they are breaking norms to bring awareness. Again they don’t owe the flag shit. They fought for this country’s freedom just as much as white people did.

> Kneeling is such a harmless way of sending a message
@Mo  ^^^^^^
We dont have the right to say what’s the wrong or right way to protest, because we don’t have to deal with what they deal with, and them kneeling affects absolutely nobody. Doesn’t change my life. Doesn’t change anyone else’s. It’s a very respectful, non intrusive way to bring awareness to an issue. It did it’s job, got people talking about it, but unfortunately a big chunk of people have tried to create a narrative about what kneeling means, rather than listening to the people kneeling about what their intentions are for kneeling
